import React, { useState } from "react";
import {
  Container,
  Typography,
  Card,
  CardContent,
  Grid,
  Button,
  CircularProgress,
  TextField
} from "@mui/material";
import { styled } from "@mui/system";
import axios from "axios";
import {
  ResponsiveContainer,
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip
} from "recharts";

const StyledCard = styled(Card)(({ theme }) => ({
  borderRadius: "20px",
  boxShadow: "0px 4px 12px rgba(0,0,0,0.1)",
  backgroundColor: "#ffffff",
  height: "100%"
}));

function KeyValueList({ data }) {
  if (!data || Object.keys(data).length === 0) {
    return <Typography>No data available.</Typography>;
  }
  return (
    <div>
      {Object.entries(data).map(([key, value]) => (
        <Typography key={key} sx={{ mb: 1 }}>
          <strong>
            {key
              .replace(/_/g, " ")
              .replace(/\b\w/g, (c) => c.toUpperCase())}
            :
          </strong>{" "}
          {typeof value === "object" && value !== null
            ? JSON.stringify(value)
            : String(value)}
        </Typography>
      ))}
    </div>
  );
}

export default function App() {
  const [transactions, setTransactions] = useState(null);
  const [payments, setPayments] = useState(null);
  const [profileText, setProfileText] = useState("");
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);

  const handleSubmit = async () => {
    if (!transactions || !profileText.trim()) {
      alert("Please upload transactions and enter profile text.");
      return;
    }
    setLoading(true);
    const formData = new FormData();
    formData.append("profile_text", profileText);
    formData.append("transactions_file", transactions);
    if (payments) {
      formData.append("payments_file", payments);
    }

    try {
      const res = await axios.post(
        "http://127.0.0.1:8000/investor_opportunity",
        formData,
        {
          headers: { "Content-Type": "multipart/form-data" }
        }
      );
      setResult(res.data);
    } catch (err) {
      console.error(err);
      alert("Error fetching data.");
    }
    setLoading(false);
  };

  const roiData = result?.roi_projections?.with_uplift || {};
  const chartData = Object.entries(roiData).map(([key, value]) => ({
    name: key,
    value: typeof value === "number" ? value : null
  }));

  return (
    <Container maxWidth="lg" sx={{ padding: "20px" }}>
      <Typography variant="h4" sx={{ mb: 3, fontWeight: "bold" }}>
        Investor Opportunity Engine
      </Typography>

      <Grid container spacing={2} sx={{ mb: 4 }}>
        {/* Upload + Input Section */}
        <Grid item xs={12} md={4}>
          <StyledCard>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Upload Transactions
              </Typography>
              <input
                key={transactions ? transactions.name : "transactions"}
                type="file"
                onChange={(e) => setTransactions(e.target.files[0])}
                style={{ marginBottom: "15px" }}
              />
              <Typography variant="h6" gutterBottom>
                Upload Payments (Optional)
              </Typography>
              <input
                key={payments ? payments.name : "payments"}
                type="file"
                onChange={(e) => setPayments(e.target.files[0])}
                style={{ marginBottom: "15px" }}
              />
              <TextField
                label="Company Profile"
                multiline
                rows={5}
                value={profileText}
                onChange={(e) => setProfileText(e.target.value)}
                fullWidth
                sx={{ borderRadius: "10px" }}
              />
              <Button
                variant="contained"
                fullWidth
                sx={{ mt: 2, borderRadius: "10px" }}
                onClick={handleSubmit}
                disabled={loading || !transactions || !profileText.trim()}
              >
                {loading ? <CircularProgress size={24} color="inherit" /> : "Analyze"}
              </Button>
            </CardContent>
          </StyledCard>
        </Grid>

        {/* Results Section */}
        <Grid item xs={12} md={8}>
          {loading ? (
            <CircularProgress />
          ) : result ? (
            <Grid container spacing={2}>
              {/* Metrics Card */}
              <Grid item xs={12} sm={6}>
                <StyledCard>
                  <CardContent>
                    <Typography variant="h6">Key Metrics</Typography>
                    <KeyValueList data={result.metrics} />
                  </CardContent>
                </StyledCard>
              </Grid>

              {/* Risk Card */}
              <Grid item xs={12} sm={6}>
                <StyledCard>
                  <CardContent>
                    <Typography variant="h6">Risk Assessment</Typography>
                    <KeyValueList data={result.risk} />
                  </CardContent>
                </StyledCard>
              </Grid>

              {/* ROI Projections */}
              <Grid item xs={12}>
                <StyledCard>
                  <CardContent>
                    <Typography variant="h6">ROI Projections</Typography>
                    {chartData.length > 0 ? (
                      <ResponsiveContainer width="100%" height={300}>
                        <LineChart data={chartData}>
                          <CartesianGrid strokeDasharray="3 3" />
                          <XAxis dataKey="name" />
                          <YAxis />
                          <Tooltip />
                          <Line
                            type="monotone"
                            dataKey="value"
                            stroke="#1976d2"
                            strokeWidth={2}
                          />
                        </LineChart>
                      </ResponsiveContainer>
                    ) : (
                      <Typography>No ROI projection data available.</Typography>
                    )}
                  </CardContent>
                </StyledCard>
              </Grid>
            </Grid>
          ) : (
            <Typography variant="body1">
              Upload data and click "Analyze" to see results.
            </Typography>
          )}
        </Grid>
      </Grid>
    </Container>
  );
}
